function hashList:getName(hash)
    if (hash == nil or (type(hash) ~= 'number' and type(hash) ~= 'string')) then return false, nil end
    if (type(hash) == 'number') then hash = tostring(hash) end
    if (self.list == nil) then return false, nil end
    
    local objectName = (self.list or {})[hash] or nil
    
    if (objectName ~= nil) then
        return true, objectName.Name or 'unknown'
    end

    return false, nil
end

